// Helper to inject CSS variable for --bg into the root of the SVG markup
function injectBg(svgString) {
  // If the SVG already has a style on the root <svg>, append the CSS variable otherwise add style attr
  return svgString.replace(/<svg([^>]*)>/, (m, attrs) => {
    if (/style=/.test(attrs)) {
      return `<svg${attrs.replace(/style=(['"])(.*?)\1/, (sm, q, val) => `style=${q}${val};--bg:var(--bg, transparent)${q}`)}>`;
    } else {
      return `<svg${attrs} style="--bg:var(--bg, transparent)">`;
    }
  });
}

// The component renders the SVG markup with dangerouslySetInnerHTML; it sets the --bg CSS var to bgColor.
// preserveAspectRatio is preserved from the source; the wrapper div controls the rendered size.
export default function DecorativeSVG({ side = "left", width = "100%", height = "200px", bgColor = "#A7F3D0", className = "" }) {
  const svgRaw = side === "left" ? LeftSVG : RightSVG;
  const svgWithBg = injectBg(svgRaw);
  // we render the SVG as-is, but wrap it so we can control width/height and flipping.
  const transformStyle = side === "right" ? { transform: "scaleX(-1)" } : undefined;

  return (
    <div
      className={className}
      style={{
        width,
        height,
        overflow: "hidden",
        display: "block",
        pointerEvents: "none",
        ...transformStyle,
        // set the CSS variable used inside the svg
        ["--bg"]: bgColor,
      }}
      // render the raw SVG markup
      dangerouslySetInnerHTML={{ __html: svgWithBg }}
    />
  );
}
